const generateShuffledCards = () => {
    const imageUrls = [
      'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcScpQU-PhBOPz2CubvFEo5DKBa5nD_M3-UlyA&s', 'url2', 'url3', 'url4', 'url5',
      'url6', 'url7', 'url8', 'url9', 'url10',
      'url11', 'url12'
    ];
  
    const cards = [...imageUrls, ...imageUrls]; 
  

    for (let i = cards.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [cards[i], cards[j]] = [cards[j], cards[i]];
    }
  
    return cards;
  };
  
  export default generateShuffledCards;
